import React, { useState } from 'react';

const DiaryEditor = (props) => {
  const [author, setAuthor] = useState('Hwan');

  const UpdateAuthor = (author) => {
    setAuthor(author);
  };

  return (
    <div className="dirayEditor">
      <h2>오늘의 일기</h2>
      <div>
        <input />
        <h3>{UpdateAuthor(author)}</h3>
      </div>
    </div>
  );
};

export default DiaryEditor;
